import NavScrollExample from './comoponet/header';
import DarkVariantExample from './comoponet/slider';
import ContainerExample from './comoponet/card';
import ContainerExample2 from './comoponet/team';
import ContainerExample3 from './comoponet/aboout';
import ContainerExamples from './comoponet/footer';


//css
import 'bootstrap/dist/css/bootstrap.min.css';
//bootstrap
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
            <Route path="./comoponet/header.js">
            <NavScrollExample />
            </Route>
            <Route path="./comoponet/slider.js">
            <DarkVariantExample />
            </Route>
            <br></br>
            <Route path="./comoponet/card.js">
              <ContainerExample />
            </Route>
            <Route path="./comoponet/team.js">
              <ContainerExample2 />
            </Route>
            <Route path="./comoponet/aboout.js">
            <ContainerExample3 />
            </Route>
            <Route path="./comoponet/footer.js">
            <ContainerExamples />
            </Route>
        </Switch>
      </Router>

    </div>
  );
}

export default App;
